import React from "react";

export default function Modal(props) {
  return (
    <form>
      <div className="mb-3">
        <label htmlFor="title" className="form-label">
          Title
        </label>
        <div>{props.name}</div>
        <div>{props.title}</div>
        <div>{props.seller}</div>
        <div>{props.price}</div>
      </div>
    </form>
  );
}
